hen the webhook will fire.'=>'Vali, millal veebikonks käivitub.','Action'=>'Tegevus','Custom'=>'Enda määratud','URL where the webhook payload is delivered.'=>'URL, kuhu veebikonksu päring saadetakse.','Secret'=>'Saladus','Created at'=>'Loodud','Updated at'=>'Uuendatud','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'See valik määrab, kuidas sa oma poes hinnad sisestad. Selle valiku muutmine ei mõjuta olemasolevate toodete hindasid.','Yes, I will enter prices inclusive of tax'=>'Jah, ma sisestan hinnad koos maksudega','No, I will enter prices exclusive of tax'=>'Ei, ma sisestan hinnad ilma maksudeta','This option determines which address is used to calculate tax.'=>'See valik määrab millist aadressi kasutatakse maksude arvutamiseks.','Customer shipping address'=>'Kliendi tarneaadressi','Customer billing address'=>'Kliendi arveaadressi','Optionally control which tax class shipping gets, or leave it so shipping tax is based on the cart items themselves.'=>'Valikuliselt võid määrata, millise maksuklassi alla transport läheb. Võid selle ka tühjaks jätta - sellisel juhul määratakse maksud ostukorvis olevate esemete põhjal.','Shipping tax class based on cart items'=>'Transpordi maksuklass põhineb ostukorvis olevatel toodetel','Rounding'=>'Ümardamine','Round tax at subtotal level, instead of rounding per line'=>'Ümarda maksusummat vahesumma juures, mitte iga tellimuse rea juures','Including tax'=>'Koos maksudega','Excluding tax'=>'Ilma maksudeta','Define text to show after your product prices. This could be, for example, "inc. Vat" to explain your pricing. You can also have prices substituted here using one of the following: {price_including_tax}, {price_excluding_tax}.'=>'Määra siin tekst, mida soovid näidata oma toodete hindade järel. See võib olla näiteks "sis. KM". Sa võid siin ka hinnad asendada, kasutades järgmisi muutujaid: {price_including_tax}, {price_excluding_tax}.','As a single total'=>'Ühe summ